        public static List<ItemEntry> GetSearchResults(string queryString)
        {
            var normalizedQuery = queryString?.ToLower() ?? "";
            return detailsItems.Where(f => f.ItemCode.ToLowerInvariant().Contains(normalizedQuery)).ToList();
